    private void AssembleEdges(SolarixGrammarEngineNET.SyntaxTreeNode node, Dictionary<int, CONNL_Edge> edges, Dictionary<int, SolarixGrammarEngineNET.SyntaxTreeNode> tokens)
    {
        tokens.Add(node.GetWordPosition(), node);

        for (int i = 0; i < node.leafs.Count; ++i)
        {
            SolarixGrammarEngineNET.SyntaxTreeNode leaf = node.leafs[i];

            CONNL_Edge edge = new CONNL_Edge();
            edge.head_index = node.GetWordPosition();
            edge.child_index = leaf.GetWordPosition();
            edge.edge_code = node.GetLinkType(i);

            edges.Add(leaf.GetWordPosition(), edge);

            AssembleEdges(leaf, edges, tokens);
        }

        return;
    }

    private void AssembleEdges(SolarixGrammarEngineNET.AnalysisResults syntax_tree, Dictionary<int, CONNL_Edge> edges, Dictionary<int, SolarixGrammarEngineNET.SyntaxTreeNode> tokens)
    {
        for (int iroot = 1; iroot < syntax_tree.Count - 1; ++iroot)
            AssembleEdges(syntax_tree[iroot], edges, tokens);

        return;
    }


    System.IO.StreamWriter wrt_train;
    System.IO.StreamWriter wrt_test, wrt_test_expected;
    System.IO.StreamWriter wrt_test_samples;

    private Dictionary<string, int> shingle2index = new Dictionary<string, int>();

    public bool ProcessSample(SampleData sample, bool train_sample, bool test_sample)
    {
        if (wrt_train == null)
        {
            //Encoding enc = Encoding.GetEncoding( "utf-8", new EncoderReplacementFallback("?"), new DecoderReplacementFallback("?"));
            UTF8Encoding enc = new UTF8Encoding(false, false);

            wrt_train = new System.IO.StreamWriter("desr_train.txt", false, enc);
            wrt_test = new System.IO.StreamWriter("desr_test.txt", false, enc);
            wrt_test_samples = new System.IO.StreamWriter("desr_test_samples.txt", false, enc);
            wrt_test_expected = new System.IO.StreamWriter("desr_test_expected.txt", false, enc);
        }

        if (sample.morphology == null)
            sample.morphology = gren.AnalyzeMorphology(sample.sample, LanguageID, SolarixGrammarEngineNET.GrammarEngine.MorphologyFlags.SOL_GREN_COMPLETE_ONLY, Constraints);

        if (sample.tokenization == null)
            sample.tokenization = gren.AnalyzeMorphology(sample.sample, LanguageID, SolarixGrammarEngineNET.GrammarEngine.MorphologyFlags.SOL_GREN_TOKENIZE_ONLY, 0);

        if (sample.syntax_tree == null)
            sample.syntax_tree = gren.AnalyzeSyntax(sample.sample, LanguageID, SolarixGrammarEngineNET.GrammarEngine.MorphologyFlags.SOL_GREN_COMPLETE_ONLY, 0, Constraints);

        if (sample.morphology.Count != sample.tokenization.Count)
        {
            return false;
        }

        if (test_sample)
            wrt_test_samples.WriteLine("{0}", sample.sample);

        if (sample.syntax_tree.Count == 3)
        {
            Dictionary<int, CONNL_Edge> edges = new Dictionary<int, CONNL_Edge>();
            Dictionary<int, SolarixGrammarEngineNET.SyntaxTreeNode> tokens = new Dictionary<int, SolarixGrammarEngineNET.SyntaxTreeNode>();

            AssembleEdges(sample.syntax_tree, edges, tokens);

            int max_index = tokens.OrderByDescending(z => z.Key).ElementAt(0).Key;
            if (max_index == tokens.Count - 1) // нет пропущенных токенов
            {
                System.Text.StringBuilder buf = new StringBuilder(100);

                foreach (var token in tokens.OrderBy(z => z.Key))
                {
                    int token_index = token.Key + 1;

                    string form = "_";

                    //     string form = token.Value.GetWord();
                    //     form.Replace( " ", "_" ).ToUpper();

                    string lemma = "";
                    if (EMIT_LEMMA)
                    {
                        lemma = gren.GetEntryName(token.Value.GetEntryID());
                    }

                    if (string.IsNullOrEmpty(lemma))
                        lemma = "_";

                    lemma = lemma.Replace(" ", "_").ToUpper();

                    string CPOSTAG = null;
                    if (EMIT_Coarse_POSTAG)
                    {
                        int id_class = gren.GetEntryClass(token.Value.GetEntryID());

                        if (id_class != -1)
                            CPOSTAG = gren.GetClassName(id_class);

                        if (string.IsNullOrEmpty(CPOSTAG) || CPOSTAG == "???")
                            CPOSTAG = "_";
                    }
                    else
                    {
                        //     int id_class = gren.GetEntryClass( token.Value.GetEntryID() );
                        //     CPOSTAG = gren.GetClassName( id_class );
                        if (string.IsNullOrEmpty(CPOSTAG) || CPOSTAG == "???")
                            CPOSTAG = "_";
                    }

                    int ipostag = tags.MatchTags(token.Value, gren);
                    string POSTAG = ipostag == -1 ? "_" : ipostag.ToString();

                    string FEATS = "";

                    if (EMIT_FEAT)
                    {
                        // В поле FEATS добавляем морфологические признаки.
                        int nfeat = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodePairsCount(token.Value.hNode);
                        for (int i = 0; i < nfeat; ++i)
                        {
                            int id_coord = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodePairCoord(token.Value.hNode, i);
                            int id_state = SolarixGrammarEngineNET.GrammarEngine.sol_GetNodePairState(token.Value.hNode, i);

                            if (!string.IsNullOrEmpty(FEATS))
                                FEATS += "|";

                            FEATS += string.Format("{0}={1}", id_coord, id_state);
                        }
                    }



                    if (EMIT_SHINGLES)
                    {
                        // В поле FEATS добавляем шинглы слов.
                        string word2 = "[" + token.Value.GetWord().ToLower() + "]";
                        int shingle_len = SHINGLE_LEN;
                        for (int i = 0; i <= word2.Length - shingle_len; ++i)
                        {
                            string shingle = word2.Substring(i, shingle_len);
                            int shingle_index = -1;
                            if (!shingle2index.TryGetValue(shingle, out shingle_index))
                            {
                                shingle_index = shingle2index.Count;
                                shingle2index.Add(shingle, shingle_index);
                            }

                            if (!string.IsNullOrEmpty(FEATS))
                                FEATS += "|";

                            FEATS += string.Format("S{0}", shingle_index);
                        }
                    }


                    if (string.IsNullOrEmpty(FEATS))
                        FEATS = "_";

                    string HEAD = null;
                    string DEPREL = null;
                    CONNL_Edge edge;
                    if (edges.TryGetValue(token.Key, out edge))
                    {
                        HEAD = (edge.head_index + 1).ToString();
                        DEPREL = gren.GetCoordStateName(0, edge.edge_code);
                    }

                    if (string.IsNullOrEmpty(DEPREL))
                    {
                        DEPREL = "ROOT";
                        HEAD = "0";
                    }

                    string PHEAD = "_";
                    string PDEPREL = "_";

                    if (test_sample)
                    {
                        wrt_test_expected.WriteLine("{0}\t{1}\t{2}\t{3}\t{4}\t{5}\t{6}\t{7}\t{8}\t{9}", token_index, form, lemma, CPOSTAG, POSTAG, FEATS, HEAD, DEPREL, PHEAD, PDEPREL);

                        HEAD = "?";
                        DEPREL = "?";

                        wrt_test.WriteLine("{0}\t{1}\t{2}\t{3}\t{4}\t{5}\t{6}\t{7}\t{8}\t{9}", token_index, form, lemma, CPOSTAG, POSTAG, FEATS, HEAD, DEPREL, PHEAD, PDEPREL);
                    }
                    else
                    {
                        wrt_train.WriteLine("{0}\t{1}\t{2}\t{3}\t{4}\t{5}\t{6}\t{7}\t{8}\t{9}", token_index, form, lemma, CPOSTAG, POSTAG, FEATS, HEAD, DEPREL, PHEAD, PDEPREL);
                    }
                }

                if (train_sample)
                {
                    wrt_train.WriteLine("");
                }
                else
                {
                    wrt_test.WriteLine("");
                    wrt_test_expected.WriteLine("");
                }

            }
        }

        return true;
    }

    public void AfterLearning()
    {
        wrt_train.Close();
        wrt_test.Close();
        wrt_test_expected.Close();
        StoreCodeBook();

        // Запускаем обучение модели
        if (true)
        {
            Console.WriteLine("Start training DESR...");
            string cmd = string.Format("{0}\\desr_train.cmd", System.IO.Directory.GetCurrentDirectory());

            System.Diagnostics.Process p = new System.Diagnostics.Process();
            p.StartInfo.FileName = cmd;

            Console.WriteLine("Executing {0}", p.StartInfo.FileName);

            bool r = p.Start();
            p.WaitForExit();
        }


        // Запускаем на проверочном наборе
        if (true)
        {
            Console.WriteLine("Start testing DESR...");
            string cmd = string.Format("{0}\\desr_test.cmd", System.IO.Directory.GetCurrentDirectory());

            System.Diagnostics.Process p = new System.Diagnostics.Process();
            p.StartInfo.FileName = cmd;

            Console.WriteLine("Executing {0}", p.StartInfo.FileName);

            bool r = p.Start();
            p.WaitForExit();

            // Оцениваем число ошибок.
            CalcErrorLevel();
        }

        return;
    }


    void CalcErrorLevel()
    {
        // Проверим результаты проверки получившейся модели.

        int n_parent_mismatch = 0;
        int n_edgetype_mismatch = 0;
        int n_edge_count = 0;


        using (System.IO.StreamReader rdr_expected = new System.IO.StreamReader("desr_test_expected.txt"))
        using (System.IO.StreamReader rdr_results = new System.IO.StreamReader("desr_result.txt"))
        {
            while (rdr_results.EndOfStream == false)
            {
                string line_result = rdr_results.ReadLine();
                string line_expected = rdr_expected.ReadLine();

                if (line_result == null)
                    break;

                if (line_result.Length == 0)
                    continue;

                string[] tx_result = line_result.Split('\t');
                string[] tx_expected = line_expected.Split('\t');

                if (tx_result[6] != tx_expected[6])
                    n_parent_mismatch++;

                if (tx_result[7] != tx_expected[7])
                    n_edgetype_mismatch++;

                n_edge_count++;
            }
        }

        Console.WriteLine("Parent mismatch error level={0}% ({1})", n_parent_mismatch * 100.0f / (float)n_edge_count, n_parent_mismatch);
        Console.WriteLine("Edge type error level={0}% ({1})", n_edgetype_mismatch * 100.0f / (float)n_edge_count, n_edgetype_mismatch);

        return;
    }


    private static void WriteStr(string str, System.IO.BinaryWriter wrt)
    {
        byte[] w8 = System.Text.Encoding.UTF8.GetBytes(str);
        wrt.Write(w8.Length);
        wrt.Write(w8);
        return;
    }

    void StoreCodeBook()
    {
        using (System.IO.StreamWriter wrt = new System.IO.StreamWriter("syntax.codebook.txt"))
        {
            wrt.Write("{0}", tags.Print());
        }

        string path = "syntax.codebook";
        if (System.IO.File.Exists(path))
            System.IO.File.Delete(path);

        using (System.IO.BinaryWriter wr = new System.IO.BinaryWriter(System.IO.File.OpenWrite(path)))
        {

            wr.Write(0);
            wr.Write(0);
            wr.Write(0);
            wr.Write(0);

            tags.Store(wr);

            wr.Write(0);

            wr.Write(-1);
            wr.Write(-1);

            wr.Write(-1);
            wr.Write(-1);

            List<KeyValuePair<string, string>> model_params = new List<KeyValuePair<string, string>>();
            model_params.Add(new KeyValuePair<string, string>("EMIT_FEAT", EMIT_FEAT.ToString()));
            model_params.Add(new KeyValuePair<string, string>("EMIT_SHINGLES", EMIT_SHINGLES.ToString()));
            model_params.Add(new KeyValuePair<string, string>("EMIT_Coarse_POSTAG", EMIT_Coarse_POSTAG.ToString()));
            model_params.Add(new KeyValuePair<string, string>("EMIT_LEMMA", EMIT_LEMMA.ToString()));
            model_params.Add(new KeyValuePair<string, string>("RICH_INPUT_TAGSET", RICH_INPUT_TAGSET.ToString()));
            model_params.Add(new KeyValuePair<string, string>("SHINGLE_LEN", SHINGLE_LEN.ToString()));

            wr.Write(model_params.Count);
            foreach (KeyValuePair<string, string> k in model_params)
            {
                WriteStr(k.Key, wr);
                WriteStr(k.Value, wr);
